import {Menu} from 'semantic-ui-react';
import Link from 'next/link';

export default function Layout(props) {
    return (<>
        <header>
            <Menu pointing secondary>
                <Menu.Item  name='home' href="/"/>
                <Menu.Item  name='about' href="/about"/>
            </Menu>
        </header>
        {props.children}
    </>)
}
